import * as React from "react";
import { Button, StatusBar, Text } from "react-native";
import styled from "styled-components";

export default MainpageToolbar = () => {
  return (
    <View style={{ flex: 1 }}>
      <Text>Home screen</Text>

      <StatusBar barStyle="light-content" />
    </View>
  );
};

